		"com/ui5strap/apps/demoapp/actions/NavigateViaMenu.action.json": "{\"//\":\"Makes the root NavContainer navigate to the view that is specified in the list item context of the specified model.\",\"BEGIN\":\"navigate\",\"navigate\":{\"TYPE\":\"ui5strap.task.Navigate\",\"modelName\":\"menu\",\"contextData\":\"= event.parameters.listItem.getBindingContextData(.modelName)\",\"VIEWS\":{\"menuTarget\":{\"id\":\"= .contextData.id\",\"transition\":\"slide-rtl\"}}}}",
		"com/ui5strap/apps/demoapp/actions/actdemo/AppendFeed.action.json": "{\"//\":\"Appends a new media list item to an existing media list.\",\"BEGIN\":\"addItemToList\",\"addItemToList\":{\"CONTROLS\":{\"titleInputField\":{\"SOURCE\":\"View\",\"TYPE\":\"ui5strap.TextInput\",\"CONTROL_ID\":\"titleInput\"},\"textInputField\":{\"SOURCE\":\"View\",\"TYPE\":\"ui5strap.TextInput\",\"CONTROL_ID\":\"messageInput\"}},\"newPostTitle\":\"= .CONTROLS.titleInputField.getValue()\",\"newPostText\":\"= .CONTROLS.textInputField.getValue()\",\"feedManager\":\"= app.getFeedManager()\",\"thenCallback\":\"= then()\",\"DO\":\"= .feedManager.newPost(.newPostTitle, .newPostText, .thenCallback)\",\"THEN\":\"= app.hideOverlay()\"}}",
		"com/ui5strap/apps/demoapp/actions/actdemo/CloseOverlay.action.json": "{\"BEGIN\":\"closeOverlay\",\"closeOverlay\":{\"DO\":\"= app.hideOverlay()\"}}",
		"com/ui5strap/apps/demoapp/actions/actdemo/FeedTap.action.json": "{\"BEGIN\":\"postDetail\",\"postDetail\":{\"commandParam\":\"command\",\"modelName\":\"FEED_INFO\",\"command\":\"= event.parameters.srcControl.data(.commandParam)\",\"postData\":\"= event.parameters.srcItem.getBindingContextData(.modelName)\",\"deleteCommand\":\"DELETE\",\"feedManager\":\"= app.getFeedManager()\",\"thenCallback\":\"= then()\",\"IF\":\"= lang.same(.command, .deleteCommand)\",\"DO\":\"= .feedManager.deletePost(.postData.id, .thenCallback)\",\"ELSE\":\"= .feedManager.postDetail(.postData.id)\"}}",
		"com/ui5strap/apps/demoapp/actions/actdemo/InitFeed.action.json": "{\"BEGIN\":\"initFeed\",\"initFeed\":{\"feedManager\":\"= app.getFeedManager()\",\"feedListId\":[\"feedList\"],\"DO\":\"= .feedManager.registerControls(controller, .feedListId)\"}}",
		"com/ui5strap/apps/demoapp/actions/actdemo/NavigateToContrdemo.action.json": "{\"//\":\"Navigate to View 'contrdemoList' via root navigation.\",\"BEGIN\":\"navigate\",\"navigate\":{\"TYPE\":\"ui5strap.task.Navigate\",\"VIEWS\":{\"contrdemoList\":{\"id\":\"contrdemoList\"}}}}",
		"com/ui5strap/apps/demoapp/actions/actdemo/NavigateToFeed.action.json": "{\"//\":\"Navigate to View 'actdemoFeed' via root navigation.\",\"BEGIN\":\"navigate\",\"navigate\":{\"TYPE\":\"ui5strap.task.Navigate\",\"VIEWS\":{\"actdemoFeed\":{\"id\":\"actdemoFeed\"}}}}",
		"com/ui5strap/apps/demoapp/actions/actdemo/PostDetail.action.json": "{\"BEGIN\":\"readPost\",\"readPost\":{\"thenCallback\":\"= then()\",\"feedManager\":\"= app.getFeedManager()\",\"DO\":\"= .feedManager.readPost(event.parameters.post.id, .thenCallback)\",\"THEN\":\"setModel\"},\"setModel\":{\"TYPE\":\"ui5strap.AMSetModel\",\"modelName\":\"POST\",\"data\":\"= action.readPost.callbackArgs.0\"}}",
		"com/ui5strap/apps/demoapp/actions/actdemo/RefreshFeed.action.json": "{\"BEGIN\":\"refreshFeed\",\"refreshFeed\":{\"feedManager\":\"= app.getFeedManager()\",\"DO\":\"= .feedManager.refreshFeed()\"}}",
